/* eslint-disable no-empty */
/* eslint-disable max-len */
import React from 'react';
import GoogleMapReact from 'google-map-react';
import LocationMarker from './LocationMarker';

const GoogleMapWithoutPolygon = ({ mapConfig, locationMarkers, setZoom, setBounds, mapRef, clusters }) => {
    console.log('RENDER - google map WITHOUT polygons');

    return (
      <GoogleMapReact 
        bootstrapURLKeys={{ key: process.env.REACT_APP_API_KEY }}
        defaultCenter={mapConfig.center}
        defaultZoom={mapConfig.zoom}
        yesIWantToUseGoogleMapApiInternals
        onGoogleApiLoaded={({ map }) => { mapRef.current = map; }}
        onChange={({ zoom, bounds }) => {
          setZoom(zoom);
          setBounds([
            bounds.nw.lng,
            bounds.se.lat,
            bounds.se.lng,
            bounds.nw.lat,
          ]);
        }}
      >
        {clusters.map((cluster, index) => {
          const [longitude, latitude] = cluster.geometry.coordinates;
          const { cluster: isCluster, point_count: pointCount } = cluster.properties;

          if (isCluster) {

          } 
            <LocationMarker key={index} lat={latitude} lng={longitude} />;
        })}
        {/* {locationMarkers} */}

      </GoogleMapReact>
      );
};

export default GoogleMapWithoutPolygon;
